import React from 'react';
import { useState } from 'react';

const Effect = () => {
  const [num, setNum] = useState(0);
  return (
    <>
      <button
        onClick={
          (() => {
            setNum(num + 1);
          },
          () => {
            alert('I am Clicked');
          })
        }
      >
        Click Me {num}
      </button>
    </>
  );
};

export default Effect;
